import{_ as e,c as a,o as p,a as t}from"./app.5b22e94d.js";const f=JSON.parse('{"title":"二月二十三日","description":"","frontmatter":{"title":"二月二十三日","date":"2023-02-23T00:00:00.000Z","tags":[2023]},"headers":[{"level":2,"title":"天气","slug":"天气","link":"#天气","children":[]},{"level":2,"title":"上班","slug":"上班","link":"#上班","children":[]},{"level":2,"title":"时间","slug":"时间","link":"#时间","children":[]}],"relativePath":"note/2023/20230223.md"}'),r={name:"note/2023/20230223.md"},i=t('<h2 id="天气" tabindex="-1">天气 <a class="header-anchor" href="#天气" aria-hidden="true">#</a></h2><p>今天天气还是很冷，不过没有下雨了，中午食堂的饭还不错，得益于我们去的早，最后几片梅菜扣肉被窝手下。</p><p>吃完饭最后一个走的，本来想转一圈，但是又觉得冷，转起没得意思，于是回去。</p><p>昨晚由于上传博客，花了一个多小时的时间，错过了睡觉的黄金时期，后来反复睡不着，于是听了一部电视剧。</p><p>最近播出的东北往事之立功，范老师演技不错，剧情也好，人物比较饱满，所以整个过程反而越听越精神，最后两点过，终于听完了。</p><p>然后又放了点啥，最后终是睡去了。</p><p>早上还醒的比较早，不过明显感觉身体还没醒，有点疲惫和酸软，可是还得去上班。</p><h2 id="上班" tabindex="-1">上班 <a class="header-anchor" href="#上班" aria-hidden="true">#</a></h2><p>上班算是划水了，今天没有写什么代码，光是和同事讨论问题了，他写代码，我出注意，基本如此，上午就是这样，到了午饭还没解决，下午接着解决。</p><p>我继续看着他，他继续写。</p><p>后来写完了，我把代码拉下来，运行了一下没有问题。</p><p>接着就没啥事儿了，我就准备学习一些blazor，他看到我在弄这个，于是我们又讨论了一番，找了一些框架，演示了一些案例。</p><p>成功混到6点，他走人，我则继续弄。</p><p>其实我还比较喜欢这门技术的，比写JavaScript好多了。</p><p>但是也有一定的缺陷，晚上回来的时候，我又研究了一下，果然还是有点问题，特别是wasm，文件读写好像不行，因为文件路径的问题。</p><p>所以我想以wasm的方式发布静态博客的方式应该是不行了，或者说我没有找对方向。</p><p>明天继续看看，如果没有要紧的任务的话。</p><h2 id="时间" tabindex="-1">时间 <a class="header-anchor" href="#时间" aria-hidden="true">#</a></h2><p>时间确实过的很快，明天就周五了，很快就三月了，应该会暖和一点吧。</p><p>而我最近也没有什么进步，内心的焦虑有点开始增多了。</p><p>回来的时候，我忽然拿出手机，刷了几下，又关掉了，完全不知道我自己要干什么，为啥要拿出手机。</p><p>没有期待，就没有失望，可能我拿出手机的时候，希望能有我感兴趣的东西出现，但是并没有，所以我又关掉了，所以，我还是一个抱有希望的人，只是常常失望而归罢了。</p>',22),n=[i];function s(d,l,c,o,_,h){return p(),a("div",null,n)}const m=e(r,[["render",s]]);export{f as __pageData,m as default};
